import React from 'react';

const Signup = () => {

    const handleSubmit = (e) => {
        e.preventDefault();
    }

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <label htmlFor="id">id</label><br />
                <input id="id"/>
                <label htmlFor="name">name</label><br />
                <input id="name"/>
                <label htmlFor="id">password</label><br />
                <input id="id"/>
                <label htmlFor="id">id</label><br />
                <input id="id"/>
            </form>
        </div>
    );
};

export default Signup;
